import './App.css';
import Counter from './Counter';
import { useSelector } from "react-redux";
// import { ICounter } from "./redux/store/counterReducer";
import { RootState } from './redux/configureStore';

function App() {
  const count: number = useSelector((state: RootState) => state.count);
  console.log("count: " + count);

  const voters: string[] = [
    "Anthony Sistilli ",
    "Bob Smith",
    "Stephanie Foo",
    "Kevin Ma"
  ];

  return (
    <div className="App">
      {voters.map(voter => (
        <Counter name={voter} />
      ))}
    </div>
  );
}

export default App;
